import React, { useState, useContext, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { UserContext } from '../context/UserContext';
import './AuthPages.css';

const LoginPage = () => {
  const [formData, setFormData] = useState({
    username: '',
    password: ''
  });
  const [errorMessage, setErrorMessage] = useState('');
  
  const { user, loginUser, error, setError } = useContext(UserContext);
  const navigate = useNavigate();
  
  const { username, password } = formData;
  
  // ÿ•ÿ∞ÿß ŸÉÿßŸÜ ÿßŸÑŸÖÿ≥ÿ™ÿÆÿØŸÖ ŸÖÿ≥ÿ¨ŸÑÿßŸãÿå ÿ™Ÿàÿ¨ŸäŸáŸá ÿ•ŸÑŸâ ŸÑŸàÿ≠ÿ© ÿßŸÑÿ™ÿ≠ŸÉŸÖ
  useEffect(() => {
    if (user) {
      navigate('/dashboard');
    }
    
    // ŸÖÿ≥ÿ≠ ÿ£Ÿä ÿ£ÿÆÿ∑ÿßÿ° ÿ≥ÿßÿ®ŸÇÿ©
    return () => {
      if (error) {
        setError(null);
      }
    };
  }, [user, navigate, error, setError]);
  
  const onChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
    setErrorMessage('');
  };
  
  const onSubmit = async (e) => {
    e.preventDefault();
    
    // ÿßŸÑÿ™ÿ≠ŸÇŸÇ ŸÖŸÜ ÿ•ÿØÿÆÿßŸÑ ÿ¨ŸÖŸäÿπ ÿßŸÑÿ®ŸäÿßŸÜÿßÿ™
    if (!username || !password) {
      setErrorMessage('Ÿäÿ±ÿ¨Ÿâ ÿ•ÿØÿÆÿßŸÑ ÿßÿ≥ŸÖ ÿßŸÑŸÖÿ≥ÿ™ÿÆÿØŸÖ ŸàŸÉŸÑŸÖÿ© ÿßŸÑŸÖÿ±Ÿàÿ±');
      return;
    }
    
    // ŸÖÿ≠ÿßŸàŸÑÿ© ÿ™ÿ≥ÿ¨ŸäŸÑ ÿßŸÑÿØÿÆŸàŸÑ
    const result = await loginUser({ username, password });
    
    if (result.error) {
      setErrorMessage(result.error);
    }
  };
  
  return (
    <div className="auth-page">
      <div className="auth-card">
        <h2 className="auth-title">ÿ™ÿ≥ÿ¨ŸäŸÑ ÿßŸÑÿØÿÆŸàŸÑ</h2>
        
        {errorMessage && (
          <div className="alert alert-error">{errorMessage}</div>
        )}
        
        <form onSubmit={onSubmit}>
          <div className="form-group">
            <label htmlFor="username">ÿßÿ≥ŸÖ ÿßŸÑŸÖÿ≥ÿ™ÿÆÿØŸÖ</label>
            <div className="input-group">
              <span className="input-icon">üë§</span>
              <input
                type="text"
                id="username"
                name="username"
                className="form-control"
                value={username}
                onChange={onChange}
                placeholder="ÿ£ÿØÿÆŸÑ ÿßÿ≥ŸÖ ÿßŸÑŸÖÿ≥ÿ™ÿÆÿØŸÖ"
              />
            </div>
          </div>
          
          <div className="form-group">
            <label htmlFor="password">ŸÉŸÑŸÖÿ© ÿßŸÑŸÖÿ±Ÿàÿ±</label>
            <div className="input-group">
              <span className="input-icon">üîí</span>
              <input
                type="password"
                id="password"
                name="password"
                className="form-control"
                value={password}
                onChange={onChange}
                placeholder="ÿ£ÿØÿÆŸÑ ŸÉŸÑŸÖÿ© ÿßŸÑŸÖÿ±Ÿàÿ±"
              />
            </div>
          </div>
          
          <button type="submit" className="btn btn-primary btn-block mb-3">
            ÿ™ÿ≥ÿ¨ŸäŸÑ ÿßŸÑÿØÿÆŸàŸÑ
          </button>
        </form>
        
        <div className="auth-links">
          <p>
            ŸÑŸäÿ≥ ŸÑÿØŸäŸÉ ÿ≠ÿ≥ÿßÿ®ÿü{' '}
            <Link to="/register" className="auth-link">
              ÿßÿ∂ÿ∫ÿ∑ ŸáŸÜÿß ŸÑÿ•ŸÜÿ¥ÿßÿ° ÿ≠ÿ≥ÿßÿ®
            </Link>
          </p>
          <p>
            <Link to="/" className="auth-link">
              ÿßŸÑÿπŸàÿØÿ© ŸÑŸÑÿµŸÅÿ≠ÿ© ÿßŸÑÿ±ÿ¶Ÿäÿ≥Ÿäÿ©
            </Link>
          </p>
          <p>
            <Link to="/guest" className="auth-link">
              ÿßŸÑÿØÿÆŸàŸÑ ŸÉÿ∂ŸäŸÅ
            </Link>
          </p>
        </div>
      </div>
    </div>
  );
};

export default LoginPage;
